import ProductsList from "../product/ProductsList";
import Loader from "../loader/Loader";
import "./style.css";

const Shop = ({ products, onAddToCart }) => {

    if(!products === null) {
        return (
            <Loader />
        );
    }

  return (
    <div className="shop">
        <ProductsList 
            products={products}
            onAddToCart={onAddToCart}
        />
    </div>
  );
}

export default Shop;
